const ll MAXN = 3000;
vector<ll> g[MAXN];
vector<ll> S;
bool dfs(ll x, ll left) {
	//printf("%d: %d\n",x,left);
	S.push_back(x);
	if (left==0) return true;
	for (auto &y: g[x]) {
		bool ok=true;
		for (auto &z:S) {
			if (z==y) ok=false;
		}
		if(ok) {
			if (dfs(y,left-1)) return true;
		}
	}
	S.pop_back();
	return false;
}

class SmilesTheFriendshipUnicorn {
	public:
	string hasFriendshipChain(int N, vector <int> A, vector <int> B) {
		ll n=N;
		ll k=A.size();
		for (ll i=0;i<k;i++) {
			ll x=A[i]; ll y=B[i];
			g[x].PB(y);
			g[y].PB(x);
		}
		for (ll x=0;x<n;x++) {
			if(dfs(x,4)) return "Yay!";
		}
		return ":(";
	}
};
